type: SUB_JOB

group_spec {
  parent_job_name: "cloud_storage_gsutil/macos/presubmit"
  parent_job_name: "cloud_storage_gsutil/macos/continuous"
}

# Environment variables to specify interpreter version.
# go/kokoro-env-vars
env_vars {
  key: "PYMAJOR"
  value: "3"
}

env_vars {
  key: "PYMINOR"
  value: "7"
}

env_vars {
  key: "BOTO_CONFIG"
  value: "/src/config/.boto_json"
}
